import Resheader from './Resheader';
import Footer from '../main/Footer';
import respic from '../../assets/respic.avif'


const Reshome = () => {
        const [isOpen, setIsOpen] = useState(false);
        const toggleDropdown = () => {
            setIsOpen(false);
          };

  return (
  <>
  <div className='flex flex-col min-h-screen'>
    <Resheader isOpen={isOpen} setIsOpen={setIsOpen}/>
    <div className='flex-grow bg-black' onClick={toggleDropdown}>
        <div className='bg-red-400 container m-auto  items-center' >
            <div className='relative inline-block m-auto my-auto items-center'>
                <img src={respic} alt="" />

            </div>
        </div>

    </div>
   <Footer/>

  </div>
  </>
  )
}

export default Reshome
